DECLARE
	PROCEDURE RunAndIgnoreErrors(in_sql IN VARCHAR2)
	AS
	BEGIN
		EXECUTE IMMEDIATE in_sql;
	EXCEPTION
		WHEN OTHERS THEN
			NULL;
	END;
BEGIN
	RunAndIgnoreErrors('ALTER TABLE csr.internal_audit_type ADD (AUDIT_COORD_ROLE_OR_GROUP_SID NUMBER(10) NULL)');
	RunAndIgnoreErrors('ALTER TABLE csr.audit_type_flow_inv_type ADD (USERS_ROLE_OR_GROUP_SID NUMBER(10) NULL)');
	RunAndIgnoreErrors('ALTER TABLE csr.audit_non_compliance ADD (audit_non_compliance_id NUMBER(10, 0),repeat_of_audit_nc_id NUMBER(10, 0))');
	RunAndIgnoreErrors('ALTER TABLE csr.audit_non_compliance MODIFY (audit_non_compliance_id NOT NULL)');
	RunAndIgnoreErrors('ALTER TABLE csr.audit_non_compliance DROP PRIMARY KEY DROP INDEX');
	RunAndIgnoreErrors('CREATE UNIQUE INDEX csr.ix_audit_non_compliance ON csr.audit_non_compliance (app_sid, internal_audit_sid, non_compliance_id)');
	RunAndIgnoreErrors('ALTER TABLE csr.audit_non_compliance ADD (CONSTRAINT pk_audit_non_compliance PRIMARY KEY(app_sid, audit_non_compliance_id),	CONSTRAINT fk_anc_repeat_anc FOREIGN KEY (app_sid, repeat_of_audit_nc_id) REFERENCES csr.audit_non_compliance (app_sid, audit_non_compliance_id))');
	RunAndIgnoreErrors('ALTER TABLE csrimp.audit_non_compliance ADD (audit_non_compliance_id NUMBER(10, 0) NOT NULL, repeat_of_audit_nc_id NUMBER(10, 0), CONSTRAINT pk_audit_non_compliance	PRIMARY KEY(csrimp_session_id, audit_non_compliance_id))');
	RunAndIgnoreErrors('ALTER TABLE csr.non_compliance_type ADD (match_repeats_by_carry_fwd NUMBER(1, 0) DEFAULT 0 NOT NULL, match_repeats_by_default_ncs NUMBER(1, 0) DEFAULT 0 NOT NULL, match_repeats_by_surveys NUMBER(1, 0) DEFAULT 0 NOT NULL, find_repeats_in_unit VARCHAR2(10) DEFAULT ''none'' NOT NULL,	find_repeats_in_qty	NUMBER(10, 0), carry_fwd_repeat_type VARCHAR2(10) DEFAULT ''normal'' NOT NULL, CONSTRAINT ck_nct_mtch_rpt_by_crry_fwd CHECK (match_repeats_by_carry_fwd IN (0, 1)), CONSTRAINT ck_nct_mtch_rpt_by_dflt_ncs CHECK (match_repeats_by_carry_fwd IN (0, 1)), CONSTRAINT ck_nct_mtch_rpt_by_surveys CHECK (match_repeats_by_carry_fwd IN (0, 1)), CONSTRAINT ck_nct_find_rpt_in CHECK ((find_repeats_in_unit IN (''all'', ''none'') AND find_repeats_in_qty IS NULL) OR (find_repeats_in_unit IN (''audits'', ''months'', ''years'') AND find_repeats_in_qty > 0)), CONSTRAINT ck_nct_crry_fwd_rpt_type CHECK (carry_fwd_repeat_type IN (''normal'', ''as_created'', ''never'')))');
	RunAndIgnoreErrors('ALTER TABLE csrimp.non_compliance_type ADD ( match_repeats_by_carry_fwd NUMBER(1, 0), match_repeats_by_default_ncs NUMBER(1, 0), match_repeats_by_surveys NUMBER(1, 0), find_repeats_in_unit VARCHAR2(10), find_repeats_in_qty NUMBER(10, 0), carry_fwd_repeat_type VARCHAR2(10))');
END;
